import React from 'react';
import ReactDOM from 'react-dom';

let options = [['Date:', 'Time:', 'Priority:', 'Title:', 'Description:', 'Category:'],['65', '65', '10', '10', '10', '10',],['25', '25', '35', '22.5', '48', ]]
let style;
export default class TaskCreate extends React.Component{
    render(){
        return(
            <div className='taskCreateWindow'>
                <form>
                    <label className='taskCreateTitle'>
                        Create Task
                    </label>
                    {
                        options[0].map((option, i) => 
                            <label className='taskCreateTxt' style={{top: `${10*i + 10}%`}}>
                                {option}
                            </label>
                        )
                    }
                    {
                        options[0].map((option, i) => 
                        <input className=' taskCreateInput' style={{left: '10%', top: `${10*i + 11}%`, height: '5%', width: `${options[1][i]}%`, left: '30%'}}>
                        
                        </input>
                    )
                    }
                </form>
            </div>
        );
    }
}
